import * as React from "react";
import { ReactSketchCanvas } from "react-sketch-canvas";

const styles = {
  border: "0.0625rem solid #9c9c9c",
  borderRadius: "0.25rem",
};

const App = () => {
  return (
    <ReactSketchCanvas
      style={styles}
      width="600"
      height="100vh"
      strokeWidth={5}
      strokeColor="red"
    />
  );
};

export default App;
